#Visual representation of the ring where you can place a sound effect to have it play at a specific frequency
class Orbital(InstructionGroup):
    def __init__(self, canvas, tempo):
        super(Orbital, self).__init__()
       
        self.img = CEllipse( cpos=(Window.width/2.,Window.height/2.), size=(tempo*100,tempo*100), segments = 100 )
        self.inner = CEllipse( cpos=(Window.width/2.,Window.height/2.), size=(tempo*100-5,tempo*100-5), segments = 100 )
        canvas.add(Color(1,1,1))
        canvas.add(self.img)
        canvas.add(Color(0,0,0))
        canvas.add(self.inner)


#Visual representation of a sound effect; a colored orb with a music note in it
class Orb(InstructionGroup):
    def __init__(self, number, canvas, x, y):
        super(Orb, self).__init__()

        self.canvas = canvas
        self.size = 50
        self.image = Rectangle(pos=(x-self.size/2., y-self.size/2.), size=(self.size,self.size), texture=Image('images/orb'+str(number)+'.png').texture)
        self.active_image = Rectangle(pos=(x-self.size/2., y-self.size/2.), size=(self.size,self.size), texture=Image('images/orb'+str(number)+'s.png').texture)
        self.color = Color(1,1,1)
        self.active_color = Color(1,1,1)
        self.vol = 1
        self.snapped = False
       
        self.canvas.add(self.active_color)
        self.canvas.add(self.active_image)
        self.canvas.add(self.color)
        self.canvas.add(self.image)
        
        self.index = None
        self.start_time = None
        self.rpm = {1:1920,2:960,3:480,4:240}

    def set_pos(self,pos):
        self.image.pos = (pos[0]-self.size/2.,pos[1]-self.size/2.)
        self.active_image.pos = (pos[0]-self.size/2.,pos[1]-self.size/2.)
        if len(pos)==3:
        	self.vol = pos[2]/2.+.5
        	self.color.a = self.vol*(not self.snapped)
        	self.active_color.a = self.vol*self.snapped
    	

    def get_pos(self):
        return self.image.pos

    def get_size(self):
        return self.size

    #makes the orb revolve on an orbital with radius radius
    def on_update(self,radius):
        index = self.index+int((kivyClock.get_time()-self.start_time)*self.rpm[radius/50])
        if index>3600:
        	self.index-=3600
        	index-=3600
        	self.set_pos((circle[index][0]*radius+Window.width/2.,circle[index][1]*radius+Window.height/2.))
        	return True
        self.set_pos((circle[index][0]*radius+Window.width/2.,circle[index][1]*radius+Window.height/2.))

    #called when an orb is set on an orbital. initializes the orbs position on the orbital so it can spin correctly
    def set_on_orbital(self,radius):
        pos = (self.image.pos[0]+self.size/2.,self.image.pos[1]+self.size/2.)
        self.index = self.search((pos[0]-Window.width/2.)/radius,(pos[1]-Window.height/2.)/radius)
        self.start_time = kivyClock.get_time()
        self.color.a = 0
        self.active_color.a = self.vol
        self.snapped = True

    def remove_from_orbital(self):
    	self.color.a = self.vol
    	self.active_color.a = 0
    	self.snapped = False

    #find the "degree" that an orb is on an orbital when it is released by searching through an array
    def search(self,x,y):
        if y>0:
            for i in range(len(circle)/2,len(circle)):
                if x>circle[i][0]:
                    return i
        else:
            for i in range(0,len(circle)/2+1):
                if x<circle[i][0]:
                    return i

#Representation of the frequency of an orbital.
class FreqRep(InstructionGroup):
    def __init__(self, number, canvas):
        super(FreqRep, self).__init__()

        self.canvas = canvas
        self.number = number
        self.size = 14
        self.image = CEllipse(cpos=(Window.width/2.-self.number*50,Window.height/2.), size=(self.size,self.size), segments = 100 )
        self.color = Color(.5,1,1,.5)
       
        self.canvas.add(self.color)
        self.canvas.add(self.image)
        
        self.index = 0
        self.start_time = kivyClock.get_time()
        self.rpm = {1:1920,2:960,3:480,4:240}

    def set_pos(self,pos):
        self.image.pos = (pos[0]-self.size/2.,pos[1]-self.size/2.)
        
    def get_pos(self):
        return self.image.pos

    def get_size(self):
        return self.size

    #makes the orb revolve on an orbital with radius radius
    def on_update(self):
        index = self.index+int((kivyClock.get_time()-self.start_time)*self.rpm[self.number])
        if index>3600:
        	self.index-=3600
        	index-=3600
        	self.set_pos((circle[index][0]*self.number*50+Window.width/2.,circle[index][1]*self.number*50+Window.height/2.))
        	return True
        self.set_pos((circle[index][0]*self.number*50+Window.width/2.,circle[index][1]*self.number*50+Window.height/2.))

#Representation of the now bar as a blue line.
class NowBar(InstructionGroup):
    def __init__(self, canvas):
        super(NowBar, self).__init__()

        self.pts = [Window.width/2.,Window.height/2.,100,100]
        self.img = Line(points = [Window.width/2.,Window.height/2.,200,Window.height/2], width = 2)
        
        canvas.add(Color(0,1,1))
        canvas.add(self.img)